import React, { useState, useEffect } from 'react';
import Header from '../Header';
import AkcelNews_page7 from '../contentBlocks/page7AkcelNews';
import DontMiss from '../contentBlocks/DontMiss';
import Footer from '../Footer';

export const LatestNews = () => { // page 6
    const [filteredNews, setFilteredNews] = useState([]);

    // useEffect to fetch or update filteredNews
    useEffect(() => {
        // Fetch or update filteredNews here
        // Example:
        const fetchNews = async () => {
            try {
                const response = await fetch('your_news_api_endpoint');
                const data = await response.json();
                // Assuming data is an array of news items
                setFilteredNews(data);
            } catch (error) {
                console.error('Error fetching news:', error);
            }
        };

        fetchNews(); // Call the fetch function
    }, []); // Empty dependency array means it runs only once after initial render

    return (
        <section>
            <Header />
            <AkcelNews_page7
                news={filteredNews}
            />
            <DontMiss />
            <Footer />
        </section>
    );
};
